import React from 'react';
import './film.css';

const Film = ({title,title_long,cover,description}) => {
    return (
        <div className='col'>
            <div className='col_rows'>
                <div className='title'>{title}</div>
                <div className='title_long'>{title_long}</div>
                <div>
                    <img src={cover} className='img'/>
                </div>
                <div>{description}</div>
            </div>
        </div>
    );
};

export default Film;
